import React from 'react';
// import Calendar from 'react-bootstrap-calendar';
import { ReactBootstrap, OverlayTrigger, Popover, Button }  from 'react-bootstrap';

class Calendar extends React.Component {
    render() {
        return (
            <React.Fragment>
                <OverlayTrigger trigger="click" overlay={<Popover placement="top"><Calendar /></Popover>}>
                    <Button>Open datepicker</Button>
                </OverlayTrigger>
            </React.Fragment>
            );
    }
}

export default Calendar;
